import React from "react";
import { Routes, Route } from "react-router-dom";
import "./App.css";

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/app")
      .then((result) => {
        return result.json();
      })
      .then((item) => {
        setData(item);
      });
  }, []);
  return (
    <div className="App">
      <header className="App-header">
        <img src="/public/logo.svg" className="App-logo" alt="logo" />
        <p>{data.maessage}</p>
      </header>
    </div>
  );
}

export default App;
